import React from "react";

export const NavBar = () => {
  return (
    <>
      <nav>
        <ul>
          <a>Home</a>
          <li>Main</li>
          <li>About us</li>
          <li>Contacts</li>
        </ul>
      </nav>
    </>
  );
};
